import { useSelector } from 'react-redux'
import { Output } from '../components/blocks/form'
import { useEffect } from 'react';

const Bill = () => {
  const selectorList = useSelector(state=>state.todos.list)

  useEffect(function() {
    console.log()
  }, [selectorList])
  return (
    <section className='bill'>
      <form action="#">
        {
          selectorList.map((id, el)=>{
            return <Output name={id} service={el}/>
          })
        }
      </form>
    </section>
  );
};

export default Bill;
